def determine_winner(test_cases):

    def nim_sum(a):
        ans = 1
        for num in a:
            ans = ans ^ num
        return ans
    results = []
    for case in test_cases:
        (N, heights) = case
        b = [0] * N
        for i in range(N):
            if heights[i] == 1:
                b[i] = 0
            else:
                b[i] = 0
                j = 2
                root = int(pow(heights[i], 0.5))
                while heights[i] != 1 and j <= root:
                    if heights[i] % j == 0:
                        while heights[i] % j == 0:
                            b[i] += 1
                            heights[i] = heights[i] // j
                    j += 1
                if heights[i] != 1:
                    b[i] += 1
        ans = nim_sum(b)
        if ans != 0:
            results.append(1)
        else:
            results.append(2)
    return results

